    @classmethod
    def shortest_charset(cls, input_str : str) -> int:
        """Find shortest suitable charset for input"""
        unique = "".join(set(input_str)) # Remove duplicates
        for index,charset in enumerate(cls.charsets):
            good_charset = True

            for char in unique:
                if char not in charset:
                    good_charset = False
                    break

            if good_charset:
                return index
        return -1

    @classmethod
    def calculate_checksum(cls, digits : int) -> int:
        sum = 0
        for d in str(digits):
            sum += int(d)
        sum+=1
        return sum % 10

    @classmethod
    def validate_checksum(cls, digits : int, expected : int) -> bool:
        try:
            int(digits)
            int(expected)
        except ValueError:
            return False
        if cls.calculate_checksum(digits) == expected:
            return True
        return False

    @classmethod
    def validate_message(cls, message : str) -> bool:
        if len(message) > 29:
            message = message[-29:]
        shortest = cls.shortest_charset(message)
        if shortest == -1:
            return False
        try:
            int(message)
        except ValueError:
            return False
        expected = int(message[-1:])
        charset_index = int(message[-4:-1])
        return cls.validate_checksum(charset_index, expected)